(2, 'IPA', 'IPA1', 1, 2, '', 'Susi siswa kelas 7 mendapat tugas dari gurunya untuk menentukan jenis benda M. susi melakukan pengukuran massa dan volume benda tersebut dengan menggunakan alat seperti pada gambar di bawah ini. \n\nBerdasarkan hasil pengukuran benda dan kesesuaian massa jenis pada tabel, maka jenis benda yang diukur tersebut adalah ... . ', '', '', 'IPA1_2.jpg', 'Aluminium   ', 'Seng  ', 'Besi', 'Kuningan ', '', '', '', '', '', '', '4', 2, 'A', 'Y', '', '', '', ''),
(3, 'IPA', 'IPA1', 1, 3, '', 'Sebuah termometer Y menunjukkan titik beku air 50oY dan titik didih air 200oY. Jika sebuah benda diukur dengan termometer Celsius duhunya 50oC, maka jiuka diukur dengan termometer Y suhunya adalah ... .', '', '', '', '100oY ', '110oY ', '125oY', '135oY', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(4, 'IPA', 'IPA1', 1, 4, '', '<p>Pada suatu percobaan, dua bimetal I dan II tersusun oleh tiga jenis logam 1, 2, dan 3. Ketiga dipanaskan kedua bimetal melengkung dengan arah tampak seperti gambar.Berdasarkan tabel tersebut, 4 orang siswa memberikan pendapat sebagai berikut ...</p>\n<p><img style=\"float: left;\" src=\"pictures/IPA1_4.jpg\" alt=\"IPA1_4.jpg\" /></p>\n<p>&nbsp;</p>\n<p>Pendapat yang benar disampaikan oleh siswa ... .</p>', '', '', 'IPA1_4.jpg', '<p>A dan B</p>', '<p>A dan D</p>', '<p>B dan C</p>', '<p>C dan D</p>', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(5, 'IPA', 'IPA1', 1, 5, '', 'Es yang massanya 50 gram dipanaskan dari -5oC menjadi air bersuhu 60oC air. Jika kalor lebur es = 80 kal /gram; kalor jenis es = 0,5 kal/gram oC, kalor jenis air = 1 kal/gram oC, maka banyaknya kalor yang diperlukan pada saat proses dari C ke D adalah ... .', '', '', 'IPA1_5.jpg', '125 kalori ', '3.000 kalori', '4.000 kalori ', '7.125 kalori', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(6, 'IPA', 'IPA1', 1, 6, '', 'Apabila salah satu ujung besi dipanaskan seperti pada gambar, maka ujung yang lain akan menjadi panas. Perpindahan kalor yang terjadi secara ... .', '', '', 'IPA1_6.jpg', 'Konduksi ', 'Konsveksi   ', 'Radiasi', 'Induksi ', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(7, 'IPA', 'IPA1', 1, 7, '', 'Perhatikan hasil ticker timer dari suatu percobaan di bawah! \n\nMana yang merupakan gerak lurus berubah beraturan dipercepat?', '', '', 'IPA1_7.jpg', 'A', 'B  ', 'C', 'D', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(8, 'IPA', 'IPA1', 1, 8, '', 'Sebuah benda dilepas dari sebuag menara dengan ketinggian 50 meter dari permukaan tanah. Jika percepatan grafitasi 10m/s2, waktu yang dibutuhkan benda hingga mencapai dasar adalah ... .', '', '', '', '', '12 sekon', '10 sekon', '12 sekon ', '', 'IPA1-8A.jpg', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(9, 'IPA', 'IPA1', 1, 9, '', 'Perhatikan gambar gaya-gaya yang bekerja pada benda berikut! .\n\nJika massa benda tersebut 2 kg, percepatan yang akan terjadi pada benda adalah ... .', '', '', 'IPA1_9.jpg', '12,5 m/s2 ', '7,5 m/s2  ', '5 m/s2 ', '2,5 m/s2', '', '', '', '', '', '', '4', 2, 'A', 'Y', '', '', '', ''),
(10, 'IPA', 'IPA1', 1, 10, '', 'Perhatikan gambar posisi ikan dalam bejana berikut!\n\nJika percepatan grafitasi bumi 10m/s2, maka tekanan hidrostatis yang dialami ikan tersebut adalah ... .', '', '', 'IPA1_10.jpg', '400 N/m2   ', '800 N/m2   ', '1.000 N/m2', '1.400 N/m2', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(11, 'IPA', 'IPA1', 1, 11, '', 'Perhatikan gambar beriku!. \n\nKedua mobil melaju di atas jalan raya dengan kecepatan mobil 1 = 20m/s dan mobil 2 = 30 m/s. Massa mobil 1 = 300 kg, massa mobil 2 = 200kg. Perbandingan energi kinetik mobil 1 dan mobil 2 adalah ... .', '', '', 'IPA1_11.jpg', '1 : 1', '2 : 3', '3 : 2', '4 : 3', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(12, 'IPA', 'IPA1', 1, 12, '', 'Seorang kuli ingin memindahkan kotak ke atas truk dengan berat 500 N dengan menggunakan bidang miring seperti pada gambar di bawah ini. Bila tinggi truk 1,5 m, berapa berat gaya yang diperlukan untuk memindahkan kotak tersebut?', '', '', 'IPA1_12.jpg', '125 N   ', '250 N  ', '500 N', '1.500 N', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(13, 'IPA', 'IPA1', 1, 13, '', '<p>Pada gambar di bawah ini, besar amplitudo, periode, frekuensi dan cepat rambat gelombang dari gambar tersebut adalah ... .</p>', '', '', 'IPA1_13.jpg', '', '', '', '', '', 'IPA1_13A.jpg', 'IPA1_13B.jpg', 'IPA1_13C.jpg', 'IPA1_13D.jpg', '', '4', 2, 'A', 'Y', '', '', '', ''),
(14, 'IPA', 'IPA1', 1, 14, '', 'Di suatu lembah yang dalam di bumi, teriakan seseorang akan terdengar bergema karena bunyi dipantulkan kembali dari gunung-gunung  yang mengelilinginya. Di lembah yang sama di bulan tidak akan terdengar gema karena ... .', '', '', '', 'Gaya tarik gravitasi di bulan lebih kecil daripada di bumi', 'Suhu di bulan lebih rendah dari pada di bumi', 'Di bulan tidak ada udara sebagai perantara bunyi untuk merambat', 'Gunung-gunung di bulan tidak dapat memantulkan bunyi', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(15, 'IPA', 'IPA1', 1, 15, '', 'Seorang anak menderita hipermetropi, dia dapat membaca buku pada titik dekat 1 meter. Agar dapat membaca pada jarak baca normal 25 cm, maka anak tersebut harus dibantu memakai kacamata dengan lensa berkekuatan ... .', '', '', '', '¾ dioptri', '4/3 dioptri   ', '3 dioptri ', '3,3 dioptri  ', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(16, 'IPA', 'IPA1', 1, 16, '', 'Benda terletak di depan cermin cekung dan bayangannya terbentuk seperti pada gambar.  \n\n Jika benda digeser dari posisi semula sejauh 10 cm menjauhi cermin, maka terbentuk bayangan baru yang jaraknya dari cermin sejauh ... .', '', '', 'IPA1_16.jpg', '15 cm   ', '20 cm  ', '40 cm', '120 cm ', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(17, 'IPA', 'IPA1', 1, 17, '', 'Suatu percobaan pemuatan listrik statis menggunakan alat dan bahan seperti pada gambar berikut. \n\nSetelah digosok berulang kali dengan kain (Gambar 1), penggaris plastik dapat menarik serpihan kertas kecil, seperti pada gambar II. Hal ini membuktikan bahwa penggaris tersebut bermuatan listrik ... .', '', '', 'IPA1_17.jpg', 'Positif, karena telah melepaskan sebagian dari elektronnya', 'Positif, karena jumlah proton pada penggaris bertambah', 'Negatif, karena telah menerima beberapa elektron dari kain', 'Negatif, karena elektron dari penggaris pindah ke kain', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(18, 'IPA', 'IPA1', 1, 18, '', 'Dua muatan titik yang sama muatannya Q, berjarak 30 cm satu sama lain dalam ruang hampa udara. Besar gaya listrik antarkeduanya adalah 2,7 Newton. Jika jarak kedua muatan kini dijadikan 10 cm, maka gaya listriknya menjadi ... .', '', '', '', '24,3 N   ', '8,1 N  ', '2,7 N', '0,9 N', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(19, 'IPA', 'IPA1', 1, 19, '', 'Sebuah rumah menggunakan peralatan listrik seperti tercantum pada tabel berikut. \n\nBeberapa besar energi listrik yang digunakan selama 1 bulan (30 hari)? ... .', '', '', 'IPA1_19.jpg', '120 kWh', '40 kWh  ', '60 kWh', '20 kWh', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(20, 'IPA', 'IPA1', 1, 20, '', 'Perhatikan gambar rangkaian listrik tertutup di bawah ini! \n\nJika hambatan dalam baterai diabaikan, maka kuat arus (I0 yang mengalir dalam rangkaian adalah ... .', '', '', 'IPA1_20.jpg', '0,5 Ampere    ', '1 Ampere   ', '2 Ampere ', '3 Ampere ', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(21, 'IPA', 'IPA1', 1, 21, '', 'Trafo memiliki efisiensi 75 %. Tegangan inputnya 220 V dan tegangan autputnya 110 V. Jika kuat arus primer yang mengalir 2 A, kuar arus sekundernya adalah ... .', '', '', '', '5 A', '4 A', '3 A', '2 A', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(22, 'IPA', 'IPA1', 1, 22, '', 'Perhatikan pernyataan berikut ! \n\nTerkenal dengan cincinnya. Dihuni oleh mahluk hidup. Mempunyai satu satelit. Berwarna kemerah-merahan. Pernyataan di atas yang termasuk ciri-ciri planet bumi adalah ... .', '', '', '', '1 dan 2   ', '1 dan 3   ', '2 dan 3', '3 dan 4', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(23, 'IPA', 'IPA1', 1, 23, '', 'Emas batangan ditempa dan dilebur untuk dijadikan cincin dan kalung. Dalam hal ini emas merupakan ... .', '', '', '', 'Unsur   ', 'Senyawa  ', 'molekul', 'Campuran', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(24, 'IPA', 'IPA1', 1, 24, '', '<p>Diketahui beberapa sifat unsur sebagai berikut:</p>\n<p>1. Konduktor.</p>\n<p>2. Titik cair dan titik didih relatif tinggi.</p>\n<p>3. Keras tetapi rapuh.</p>\n<p>4. Massa jenis relatif besar.</p>\n<p>Yang merupakan sifat umum dari logam adalah ... .</p>', '', '', '', '<p>(1), (2), dan (3)</p>', '<p>(1), (2), dan (4)</p>', '<p>(1), dan (3)</p>', '<p>(2) dan (4)</p>', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(25, 'IPA', 'IPA1', 1, 25, '', 'Atom 6C13, artinya ... . ', '', '', '', 'Atom karbon, nomor atom 6 dan nomor massa 13', 'Atom karbon, nomor atom 13 dan nomor massa 6', 'Atom kalsium, nomor atom 6 dan nomor massa 13', 'Atom kalsium, nomor atom 13 dan nomor massa 6', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(26, 'IPA', 'IPA1', 1, 26, '', 'Data hasil percobaan: \nAir dipanaskan akan menguap. \nLogam dipanaskan akan membara. \nBesi dibiarkan di tempat terbuka mengalami korosi. \nGaram dibuat dengan mencampurkan asam dan basa. \nBerdasarkan data, yang termasuk perubahan kimia adalah pasangan nomor  ... .', '', '', '', '(1) dan (2)   )', '(1) dan (3)   ', '(2) dan (3)', '(3) dan (4)', '', '', '', '', '', '', '4', 2, 'A', 'Y', '', '', '', ''),
(27, 'IPA', 'IPA1', 1, 27, '', 'Hasil pemisahan zat dengan penyaringan ditentukan oleh : \n1. Tingkat kerapatan alat penyaringnya. \n2. Kerapatan zat yang dipisahkannya. \n3. Jenis zat yang disaring.\n4. Ukuran partikel zat yang disaring. \nPernyataan yang benar adalah ... .', '', '', '', '(1), (2), dan (3)  ', '(1), (2), dan (4)  ', '(1), (3), dan (4)', '(2), (3), dan (4)', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(28, 'IPA', 'IPA1', 1, 28, '', 'Perhatikan data berikut! \n\nDari data di atas, pasangan larutan yang bersifat asam adalah ... .', '', '', 'IPA1_28.jpg', 'I dan II   ', 'II dan III   ', 'II dan IV ', 'III dan IV', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(29, 'IPA', 'IPA1', 1, 29, '', 'Seorang siswa mencampurkan dua jenis larutan yang tidak berwarna. Diantara pernyataan berikut ini yang tidak menunjukkan telah terjadi reaksi kimia adalah ... .', '', '', '', 'Perubahan warna', 'Terbentuknya bidang batas antara kedua cairan', 'Timbul gas', 'Terbentuk endapan', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(30, 'IPA', 'IPA1', 1, 30, '', 'Ketika memasak makanan, terjadi perubahan-perubahan sebagai berikut: \nPanci menjadi panas. \nMakanan menjadi matang. \nKuah makanan menguap. \nPerubahan yang tergolong reaksi kimia adalah ... .', '', '', '', '-1', '-2', '-3', '(1), (2), dan (3)', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(31, 'IPA', 'IPA1', 1, 31, '', 'Perhatikan tabel berikut!  \n\nZat tidak termasuk pasangan bahan pewarna sintesis adalah ... .', '', '', 'IPA1_31.jpg', '(1) dan (2)   ', '(1) dan (3)   ', '(2) dan (4)', '(3) dan (4)', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(32, 'IPA', 'IPA1', 1, 32, '', 'Dampak fisiolagis dari penyalahgunaan narkoba adalah ... .', '', '', 'IPA1_32.jpg', 'Penurut  ', 'Berperilaku positif ', 'Peduli dan percaya diri', 'Gejala tersiksa dan mengurung diri', '', '', '', '', '', '', '4', 2, 'A', 'Y', '', '', '', ''),
(33, 'IPA', 'IPA1', 1, 33, '', 'Berdarakna persamaan ciri yang dimilikinya, kura-kura, buaya, dan cicak termasuk dalam kelompok yangsama. Ciri yang sama dari hewan-hewan tersebut adalah ... .', '', '', '', 'Poikiloterm ', 'Hidup di dua alam  ', 'menyusui anaknya ', 'bergerak dengan kaki ', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(34, 'IPA', 'IPA1', 1, 34, '', 'Perhatikan daftar tumbuhan berikut ini!. \n1. Jambu. \n2. Padi. \n3.Kelapa.\n 4. Nangka.  \n5. Alang-alang. \nTumbuhan yang bentuk daunnya seperti pita adalag ... .', '', '', '', '(1), (2), dan (3) ', '(1), (3), dan (4)  ', '(2), (3), dan (4)', ' (2), (3), dan (5)', '', '', '', '', '', '', '4', 2, 'A', 'Y', '', '', '', ''),
(35, 'IPA', 'IPA1', 1, 35, '', 'Perhatikan gambar jaring-jaring makanan berikut!  \n\nJika tikus kebun dibasmi, yang akan terjadi adalah ... .', '', '', 'IPA1_35.jpg', 'Populasi burung hantu meningkat', 'Populasi rumput menurun', 'Populasi rajawali menurun', 'Populasi kelinci menurun ', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(36, 'IPA', 'IPA1', 1, 36, '', 'Perhatikan gambar berikut!  \n\nGambar tersebut menunjukkan daerah perairan yang tercemar oleh limbah deterjen yang berasal dari rumah tangga dan pabrik. Usaha yang seharusnya dapat dilakukan untuk mencegah pencemaran tersebut adalah ... .', '', '', 'IPA1_36.jpg', 'Menyaring senyawa organik dengan zat tertentu', 'Membangun saluran baru untuk mengalirkan limbah', 'Melakukan pengolahan limnag sebelum dibuang ke perairan', 'Menanami perairan dengan tanaman eceng gondok', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(37, 'IPA', 'IPA1', 1, 37, '', 'Perhatikan gambar berikut!  \n\nGerakan yang dapat dilakukan oleh sendi seperti ditunjuk panah adalah ... .', '', '', 'IPA1_37.jpg', 'Searah   ', 'Memutar   ', 'kaku ', 'ke segala arah ', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(38, 'IPA', 'IPA1', 1, 38, '', 'Struktur tulang yang membentuk tulang betis tampak seperti gambar berikut!', '', '', 'IPA1_38.jpg', '1', '2', '3', '4', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(39, 'IPA', 'IPA1', 1, 39, '', 'Enzim yang dihasilkan oleh organ X dan fungsinya adalah ... .', '', '', 'IPA1_39.jpg', 'Lipase, mencerna lemak', 'Ptialin, mengubah tepung menjadi gula', 'Pepsin, menguraikan protein menjadi asam amino ', 'Renin, mengendapkan protein susu ', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(40, 'IPA', 'IPA1', 1, 40, '', 'Hubungan yang tepat antara enzim dan fungsinya dalam tebel berikut adalah ... ', '', '', 'IPA1_40.jpg', '', '', '', '', '', 'IPA1_40A.jpg', 'IPA1_40B.jpg', 'IPA1_40C.jpg', 'IPA1_40D.jpg', '', '2', 2, 'A', 'Y', '', '', '', ''),
(41, 'IPA', 'IPA1', 1, 41, '', 'Perhatikan macam-macam gangguan pada sistem pernafasan di bawah ini!  \n(1). Kontraksi yang kaku dari bronkiolus -  \n(2). Peradangan pada selaput pembungkus paru-paru -\n(3). Hipersensitif Bronkiolus terhadap debu dan asap rokok - \n(4). Infeksi bakteri . \nGangguan yang menyebabkan terjadinya pleuritis adalah ... .', '', '', '', '(1) dan (3)   ', '(1) dan (4)   ', '(2) dan (3)', '(2) dan (4) ', '', '', '', '', '', '', '4', 2, 'A', 'Y', '', '', '', ''),
(42, 'IPA', 'IPA1', 1, 42, '', 'Perbedaan antara pernafasan eksternal dan pernafasan internal adalah ... .', '', '', '', 'Pernafasan eksternal adalah pertukaran O2 dan CO2 di paru-paru, pernafasan internal adalah pertukaran O2 dan CO2 di sel-sel tubuh', 'Pernafasan eksternal terjadi pada sel tubuh, pernafasan internal terjadi di paru-paru', 'Pernafasan eksternal adalah pertukaran O2 dan CO2 diarteri, pernafasan internal adalah pertukaran O2 dan CO2 di vena', 'Pernafasan eksternal adalah pertukaran O2 dan CO2 di dalam pembuluh darah, pernafasan internal adalah pertukaran O2 dan CO2 di paru-paru ', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(43, 'IPA', 'IPA1', 1, 43, '', 'Ciri-ciri pembuluh darah : \n(1). Aliran darah masuk ke jantung - \n(2). Elastis dan tebal - \n(3). Aliran darah keluar jantung - \n(4). Terletak lebih dekat ke permukaan kulit . \nCiri-ciri pembuluh arteri ditunjukkan oleh ... .', '', '', '', '(1) dan (2)   ', '(1) dan (4)   ', '(2) dan (3)', '(3) dan (4) ', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(44, 'IPA', 'IPA1', 1, 44, '', 'Hasil uji golongan darah dua orang siswa sebagai berikut!    \nSiswa I: darah dengan serum a tidak menggumpal, darah serum B menggumpal. \nSiswa II darah dengan serum a menggumpal, darah dengan serum B menggumpal. \nBerdasarkan hasil uji tersebut, maka golongan darah siswa I dan II adalah ... .', '', '', '', 'A dab AB   ', 'A dan O   ', 'B dan AB ', 'A dan B ', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(45, 'IPA', 'IPA1', 1, 45, '', 'Perhatikan gambar ginjal berikut!   \n\n Proses yang terjadi pada bagian P adalah ... .', '', '', 'IPA1_45.jpg', 'Penyaringan darah dari sisa metabolisme ', 'Penyerapan kembali zat-zat yang masih bermanfaat bagi tubuh', 'Penyaluran urine menuju rongga ginjal melalui tubulus collectivus', 'Melakukan augmentasi dari urine primer ', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
(46, 'IPA', 'IPA1', 1, 46, '', 'Perhatikan gambar oogenesis berikut!    \n\nPada peristiwa oogenesis terjadi pembelahan mitosis maupun meiosis. Pembelahan secara meiosis terjadi pada nomor ... .', '', '', 'IPA1_46.jpg', '1 dan 2  ', '1 dan 3  ', '2 dan 3', '2 dan 4', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
(47, 'IPA', 'IPA1', 1, 47, '', 'Perhatikan gambar otak manusia berikut!      \n\nBagian yang berfungsi sebagai pusat penglihatan ditunjukkan oleh ... .', '', '', 'IPA1_47.jpg', '1', '2', '3', '4', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(48, 'IPA', 'IPA1', 1, 48, '', 'Percobaan yang membuktikan bahwa pada fotosintesis dihasilkan oksigen, ditunjukkan oleh gambar ... .', '', '', 'IPA1_48.jpg', 'A', 'B', 'C', 'D', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(49, 'IPA', 'IPA1', 1, 49, '', 'Hewan dan tumbuhan melakukan adaptasi terhadap lingkungannya dengan berbagai cara sebagai berikut ... . \n1. Bentuk paruh bangau panjang karena hidup di daerah yang berair dan memangsa ikan - \n2. Batang teratai berongga agak dapat mengapung di dalam air  - \n3. Paus muncul ke permukaan air untuk bernafas - \n4. Cicak memutuskan ekornya ketika menghadapi predator.    \nPernyataan tersebut yang termasuk adaptasi morfologi adalah ... .', '', '', '', '(1) dan (2)   ', '(1) dan (3)   ', '(2) dan (4)', '(3) dan (4) ', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(50, 'IPA', 'IPA1', 1, 50, '', 'Persilangan antara tanaman padi bulir besar, berumur panjang (BBPP) dengan tanaman padi bulir kecil berumur pendek (bbpp) sebagai berikut :        \n\nBila sifat bulir besar dan berumur pendek merupakan sifat-sifat unggul, genotipe pada F2 yang paling baik disilangkan untuk mendapatkan bibit unggul adalah genotipe ... dengan genotipe ...', '', '', 'IPA1_50.jpg', '1  x 16   ', '4   x 13   ', '6  x 14', '11  x 12', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
