(63, 'IPS', 'IPS1', 1, 13, '', 'Mengucapkan salam ketika bertemu, mengangukkan kepala sebagai tanda hormat kepada orang lain, serta membuang sampah pada tempatnya. Merupakan contoh dari cara-cara bertindak yang digemari oleh masyarakat, sehingga dilakukan berulang ulang. Apabila perbuatan tersebut tidak dilakukan, maka dianggap sebagai penyimpangan. Contoh tersebut menunjukkan jenis norma ....', '', '', '', 'folkways/ kebiasaan', 'mores/ kelakuan', 'customs/ adat', 'usage/cara', '', '', '', '', '', '', '1', 2, 'A', 'Y', '', '', '', ''),
(64, 'IPS', 'IPS1', 1, 14, '', 'Indonesia kaya akan rempah-rempah menyebabkan bangsa-bangsa Eropa datang ke Indonesia. Awalnya kedatangan bangsa Eropa hanya pada aktivitas perdagangan, tetapi pada akhirnya bermuara pada penguasaan wilayah. Pada masa pemerintahan Kolonial Belanda, rakyat dipaksa bekerja untuk kepentingan Belanda, tanpa memikirkan keadaannya sendiri. Dampak kolonialisme dan imperialisme Barat di Indonesia dalam bidang sosial adalah â€¦.', '', '', '', 'berkembangnya sistem perdagangan ', 'berkurangnya lahan pertanian', 'terbentuknya stratifikasi sosial', 'penggunaan bahasa Belanda', '', '', '', '', '', '', '3', 2, 'A', 'Y', '', '', '', ''),
