(67, 'IPS', 'IPS1', 1, 17, '', 'Dany seorang pengusaha memberi bantuan kepada orang yang terkena musibah dan membangun tempat ibadah.Tindakan ekonomi yang dilakukan oleh Dany didorong oleh keinginan untuk ....', '', '', '', 'memperoleh keuntungan', 'membantu sesama manusia ', 'memenuhi kebutuhan sendiri', 'memperoleh penghargaan masyarakat', '', '', '', '', '', '', '2', 2, 'A', 'Y', '', '', '', ''),
