(170, 'MAT', 'MAT-test', 1, 30, '', '<p>Sebuah papan berbentuk lingkaran dengan panjang jari-jarinya 63 cm. Pada papan tersebut terdapat daerah berbentuk juring dengan sudut pusat 80<sup>o</sup> yang diberi warna. Pada keliling daerah yang diberi warna dipasang tali 2 kali putaran. Panjang tali yang diperlukan adalah &hellip;.</p>', '', '', '', '<p>88 cm</p>', '<p>126 cm</p>', '<p>214 cm</p>', '<p>428 cm</p>', '', '', '', '', '', '', '1', 2, 'A', 'T', '', '', '', ''),
(171, 'MAT', 'MAT-test', 1, 31, '', '', '', '', 'MAT1-31.jpg', '<p>900 cm<sup>2</sup></p>', '<p>750 cm<sup>2</sup></p>', '<p>675 cm<sup>2</sup></p>', '<p>600 cm<sup>2</sup></p>', '', '', '', '', '', '', '2', 2, 'A', 'T', '', '', '', ''),
(172, 'MAT', 'MAT-test', 1, 32, '', 'Diketahui data nilai ujian akhir semester sekelompok siswa adalah sebagai berikut:', '', '', 'MAT1-32.jpg', '7', '7.5', '8', '8.5', '', '', '', '', '', '', '3', 2, 'A', 'T', '', '', '', ''),
(173, 'MAT', 'MAT-test', 1, 33, '', '<p>Kubah sebuah gedung berbentuk setengah bola dengan diameter 14 m, akan dilapisi aluminium pada bagian luarnya. Luas aluminium yang dibutuhka]]n adalah &hellip;.</p>', '', '', '', '<p>154 m<sup>2</sup></p>', '<p>308 m<sup>2</sup></p>', '<p>462 m<sup>2</sup></p>', '<p>1.232 m<sup>2</sup></p>', '', '', '', '', '', '', '4', 2, 'A', 'T', '', '', '', ''),
(174, 'MAT', 'MAT-test', 1, 34, '', '', '', '', 'MAT1-34.jpg', '<p>240 cm<sup>2</sup></p>', '<p>250 cm<sup>2</sup></p>', '<p>480 cm<sup>2</sup></p>', '<p>500 cm<sup>2</sup></p>', '', '', '', '', '', '', '2', 2, 'A', 'T', '', '', '', ''),
(175, 'MAT', 'MAT-test', 1, 35, '', '<p>Diketahui &Delta; KLM kongruen dengan &Delta; PQR. Jika besar &ang; LKM = 60<sup>o</sup>, &ang;KML = 75<sup>o</sup>, &ang;QPR = 60<sup>o</sup>, dan &ang;PRQ = 45<sup>o</sup>, maka pasangan sisi yang sama panjang adalah &hellip;.</p>', '', '', '', '<p>KL = PR</p>', '<p>KL = QR</p>', '<p>KL = PQ</p>', '<p>KL = QR</p>', '', '', '', '', '', '', '1', 2, 'A', 'T', '', '', '', ''),
(176, 'MAT', 'MAT-test', 1, 36, '', '', '', '', 'MAT1-36.jpg', '<p>10 ton</p>', '<p>15 ton</p>', '<p>20 ton</p>', '<p>25 ton</p>', '', '', '', '', '', '', '1', 2, 'A', 'T', '', '', '', ''),
(177, 'MAT', 'MAT-test', 1, 37, '', '<p>Pada sebuah kaleng terdapat 5 bola berwarna merah, 12 bola berwarna kuning, dan 7 bola berwarna hitam. Jika diambil sebuah bola secara acak, peluang terambilnya bola berwarna hitam adalah &hellip;.</p>', '', '', '', '<p><span class=\"AM\">`1/24`</span></p>', '<p><span class=\"AM\">`5/24`</span></p>', '<p><span class=\"AM\">`7/24`</span></p>', '<p><span class=\"AM\">`1/2`</span></p>', '', '', '', '', '', '', '3', 2, 'A', 'T', '', '', '', ''),
(178, 'MAT', 'MAT-test', 1, 38, '', '<p>Sebuah dadu dilambungkan sekali. Peluang muncul mata dadu kelipatan tiga adalah &hellip;.</p>', '', '', '', '<p><span class=\"AM\">`1/6`</span></p>', '<p><span class=\"AM\">`2/6`</span></p>', '<p><span class=\"AM\">`3/6`</span></p>', '<p><span class=\"AM\">`2/3`</span></p>', '', '', '', '', '', '', '2', 2, 'A', 'T', '', '', '', ''),
(179, 'MAT', 'MAT-test', 1, 39, '', 'Data berikut merupakan nilai ulangan matematika yang diperoleh siswa kelas IX-A:', '', '', 'MAT1-39.jpg', '4 siswa', '15 siswa', '23 siswa', '30 siswa', '', '', '', '', '', '', '3', 2, 'A', 'T', '', '', '', ''),
(180, 'MAT', 'MAT-test', 1, 40, '', 'Nilai rata-rata ujian matematika di suatu kelas 80. Nilai rata-rata siswa putra 75 dan nilai rata-rata siswa putrid 84. Jika banyak siswa di kelas tersebut 36 orang, maka banyaknya siswa putri adalah â€¦.', '', '', '', '16 siswa', '18 siswa', '20 siswa', '24 siswa', '', '', '', '', '', '', '3', 2, 'A', 'T', '', '', '', '');
